import './Header.css'

function Header() {
  return (
    <header>
      <img src="img/logo.jpg"/>
      <div className="header-info">
        <h1>SweetEst</h1>
        <p>Անվճար առաքում</p>
        <p>հեռ․ +37498107711</p>
      </div>
      <nav>
        <ul>
          <li><a href="#">Մեր մասին</a></li>
          <li><a href="#">Տեսականի</a></li>
          <li><a href="#">Կապ</a></li>
        </ul>
      </nav>
    </header>
  );
}
export default Header;
